result = result.copy()
    counters = {}

    for url in result:
        url_value = str(url["http"]).strip()
        url_key = url["http"]

        if url_value.startswith("http://www"):
            url_value = "https://" + url_value[8:]

        if re.match(r"^https?://", url_value):
            url_key = url_value
        else:
            url_value = "http://" + url_value

        if url_key in counters:
            counters[url_key] += 1
        else:
            counters[url_key] = 1

    return counters

