most_common_values = Counter([x["url"] for x in result]).most_common()

    # Remove any values that only occur once (keys are the ones with the most common values)
    keys_to_remove = [key for key, count in most_common_values if count == 1]

    for key in keys_to_remove:
        most_common_values.remove((key, most_common_values[key]))

    return dict(most_common_values)

